import React from "react";

const FormBodyRow = ({OnMyChange,Info,label,name}) => {

  return (
    <tr>
      <td>{label}</td>
      <td>
        <input
          type={Info.type}
          min={Info.min}
          max={Info.max}
          value={Info.value}
          disabled={Info.disable}
          name={name}
          onChange={OnMyChange}
        />
      </td>
      <td>{Info.value}</td>
    </tr>
  );
};

export default FormBodyRow;
